import React, { Fragment, useState } from 'react';
import axios from 'axios';

const Configuration = () => {
  const [configuration, setconfiguration] = useState(null);

  const getConfiguration = async e => {
    e.preventDefault();
    try {
      const config = {
        headers: {
          'Content-Type': 'application/json',
          'Access-Control-Allow-Origin': '*'
        }
      };
      const res = await axios.get('/api/configurations/v2', config);
      setBooks(res.data);
      console.log(res.data);
      return (
        // <Fragment>
        //   <div>{res.data.description}</div>
        <p>hi dddddddd</p>
        // </Fragment>
      );
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <Fragment>
      <button variant='primary' onClick={e => getConfiguration(e)}>
        Get Configuration
      </button>
      {books && (
        <div>
          <p>{books.description}</p>
          <p>{books.locales}</p>
          <p>{books.maximumAmount.amount}</p>
          <p>{books.maximumAmount.amount}</p>
          <p>{books.minimumAmount.amount}</p>
          <p>{books.minimumAmount.currency}</p>
          <p>{books.numberOfPayments}</p>
          <p>{books.promotionUrl}</p>
          <p>{books.type}</p>
        </div>
      )}
    </Fragment>
  );
};

export default Configuration;
